#ifdef NOGOBUILD
// 解码 varint 32 64俩种
void decode(uint8_t *in, uint64_t *out, int32_t *cnt) {
    // 从高位往低位放
    __m128i a = _mm_set_epi8(in[0], in[1], in[2], in[3], in[4], in[5], in[6], in[7], in[8], in[9], in[10], in[11], in[12], in[13], in[14], in[15]);

    uint64_t a0 = a[0];
    uint64_t a1 = a[1];
    printf("start: \n");
    printf("a[0]: ");
    printBits(sizeof(a[0]), &a0);
    printf("a[1]: ");
    printBits(sizeof(a[0]), &a1);
    puts("");

    // varint 字节数
    uint16_t b = _mm_movemask_epi8(a);
    int bytes_num = __builtin_clz((~b) << 16) + 1;
    *cnt = bytes_num;

    // varint8
    if (bytes_num == 1) {
        *out = (a[1] >> 56) & 0x7f;
        return;
    }

    // 去除最高位
    a = _mm_and_si128(a, _mm_set1_epi64((__m64)0x7f7f7f7f7f7f7f7f));

    // varint32
    __m128i bytes_decode = _mm_shuffle_epi8(a, _mm_setr_epi64((__m64)shuffle_vec[bytes_num], (__m64)0xffffffffffffffff));

    // a0 = bytes_decode[0];
    // a1 = bytes_decode[1];
    // printf("bytes_decode: \n");
    // printf("a[0]: ");
    // printBits(sizeof(a[0]), &a0);
    // printf("a[1]: ");
    // printBits(sizeof(a[0]), &a1);
    // puts("");

    // __m128i tmp1 = _mm_setr_epi8(14, -1, 13, -1, -1, -1, -1, 15, -1, -1, -1, -1, -1, -1, -1, -1);
    // a0 = tmp1[0];
    // a1 = tmp1[1];
    // printf("tmp1: \n");
    // printf("a[0]: ");
    // printBits(sizeof(a[0]), &a0);
    // printf("a[1]: ");
    // printBits(sizeof(a[0]), &a1);
    // puts("");

    // uint64_t tmp2 = shuffle_vec[bytes_num];
    // printf("tmp2: ");
    // printBits(sizeof(tmp2), &tmp2);
    // puts("");

    __m128i split_bytes = _mm_mullo_epi16(bytes_decode, _mm_setr_epi16(128, 64, 32, 16, 128, 64, 32, 16));
    __m128i shifted_split_bytes = _mm_slli_epi64(split_bytes, 8);
    __m128i recombined = _mm_or_si128(split_bytes, shifted_split_bytes);
    __m128i low_byte = _mm_srli_epi64(bytes_decode, 56);
    __m128i result_evens = _mm_or_si128(recombined, low_byte);

    // a0 = result_evens[0];
    // a1 = result_evens[1];
    // printf("result_evens: \n");
    // printf("a[0]: ");
    // printBits(sizeof(a[0]), &a0);
    // printf("a[1]: ");
    // printBits(sizeof(a[0]), &a1);
    // puts("");

    __m128i result = _mm_shuffle_epi8(result_evens, _mm_setr_epi8(0, 2, 4, 6, 8, 10, 12, 14, -1, -1, -1, -1, -1, -1, -1, -1));

    // a0 = result[0];
    // a1 = result[1];
    // printf("result: \n");
    // printf("a[0]: ");
    // printBits(sizeof(a[0]), &a0);
    // printf("a[1]: ");
    // printBits(sizeof(a[0]), &a1);
    // puts("");

    uint64_t res = 0;
    _mm_storeu_si64((void *)&res, result);
    *out = res;

    // printf("final: ");
    // printBits(sizeof(a[0]), &res);
    // puts("");

    // varint32 + 8
    if (bytes_num == 6) {
        *out = ((a[1] & 0x7f0000) << (35 - 16)) | ((a[1] & 0x70000000) << 4) | res;
        return;
    }

    // varint64
    if (bytes_num > 6) {
        // 解码高32位
        __m128i bytes_decode_64 = _mm_shuffle_epi8(a, _mm_setr_epi64((__m64)shuffle64_vec[bytes_num], (__m64)0xffffffffffffffff));
        split_bytes = _mm_mullo_epi16(bytes_decode_64, _mm_setr_epi16(128, 64, 32, 16, 128, 64, 32, 16));
        shifted_split_bytes = _mm_slli_epi64(split_bytes, 8);
        recombined = _mm_or_si128(split_bytes, shifted_split_bytes);
        low_byte = _mm_srli_epi64(bytes_decode_64, 56);
        result_evens = _mm_or_si128(recombined, low_byte);
        result = _mm_shuffle_epi8(result_evens, _mm_setr_epi8(0, 2, 4, 6, 8, 10, 12, 14, -1, -1, -1, -1, -1, -1, -1, -1));
        uint64_t res_64 = 0;
        _mm_storeu_si64((void *)&res_64, result);
        *out = ((res_64 & 0x0000000001fffffff) << 35) | ((a[1] & 0x70000000) << 4) | res;
    }
}

#endif

